TERMS AND CONDITIONS

How long parcels take to arrive depends upon the destination (ask us). We really do our best to be as fast as ever possible! We ship orders 24/7/365, still, we are not Amazon prime. In times of stronger surveillance we send parcels with tracking (increases shipping time in favor of safety);

Naturally we do our best but ultimately any risk regarding shipping is borne out by you, the buyer. We are not Amazon prime and regrettably we cannot refund/reship if product doesn't arrive; If any problems occur, CONTACT US, WE WILL find a solution; resend is out of the question if there is dispute, negative feedback or shipment tracking shows delivery.

NORMALLY we ship from Germany, but considering destination also from a neighboring country (i drive a truck); we deliver very fast;

+ Please support us by RELEASE FUND when you received your package. dont leave your order auto finalize
